INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(1, 'Rana común', 'Pelophylax perezi', 1, 'Pelophylax perezi, la rana común, es una especie de anfibio anuro de la familia Ranidae. Es una rana de tamaño mediano a grande, pudiendo alcanzar los 11 cm de longitud en las hembras, aunque no suele sobrepasar los 8 cm. Posee una coloración verde y marrón muy variable, con manchas negras, con una línea vertebral verde más clara y sin la característica mancha temporal de las ranas pardas. El vientre es de color grisáceo.\r\n<br>\r\nEl tímpano es conspicuo y los pliegues glandulares dorsolaterales están moderadamente desarrollados; ambos de color bronce. Es una rana muy estilizada, con largas patas. Tiene cuatro dedos en las extremidades anteriores y cinco en las posteriores que están unidos por membranas interdigitales muy desarrolladas. La pupila del ojo es horizontal. Los machos tienen sacos vocales de color grisáceo en las comisuras de la boca.\r\n<br>\r\nLlegan a vivir hasta seis años, aunque lo más habitual es dos o tres años.\r\n', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(2, 'Sapo corredor', 'Epidalea calamita', 1, 'El sapo corredor (Epidalea calamita) es una especie monotípica del género Epidalea. Es un anfibio anuro de la familia Bufonidae, nativa de áreas arenosas de Europa central y occidental. Se encuentra en una amplia variedad de hábitats, siendo capaz de sobrevivir en zonas bastante secas siempre que disponga al menos de alguna charca para reproducirse. De hecho, es uno de los anfibios más comunes en gran parte de su área de distribución. Los adultos miden unos 6 cm de longitud. Se distingue del sapo común por una línea amarilla o verde claro longitudinal en la mitad de la espalda. \r\n<br>\r\nCuerpo rechoncho y muy verrugoso; glándulas parotídeas paralelas. Tienen patas relativamente largas que le dan su distintivo andar en contraste con los movimientos de salto de muchas otras especies de sapos.', 2, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(3, 'Tritón ibérico', 'Lissotriton boscai', 1, 'El tritón ibérico (Lissotriton boscai, antes Triturus boscai) es una especie de anfibio urodelo de la familia Salamandridae, endémico de la mitad noroccidental de la Península ibérica.\r\n<br>\r\nDe tamaño pequeño, compacto, de hocico redondeado, a menudo con un surco longitudinal. Dorso parduzco en el macho y pardo aceituna en la hembra. Vientre amarillo a naranja con bordes claros y manchado de negro. Miden entre 8 y 9 cm. Se alimenta de gusanos, insectos y pequeños crustáceos.\r\n<br>\r\nPasan el día bajo las piedras, saliendo a cazar de noche. Se aparean en charcas y estanques pequeños, también en pozos. Observa retiro invernal.', 2, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(4, 'Gallipato', 'Pleurodeles waltl', 1, 'El gallipato (Pleurodeles waltl) es el mayor anfibio urodelo de Europa, un tritón que puede llegar a alcanzar los 30 cm de longitud, de los que aproximadamente la mitad corresponden a la cola. Se encuadra en la familia Salamandridae, la misma que la salamandra común y la mayoría de los urodelos europeos.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(5, 'Cormorán ', 'Phalacrocorax carbo', 2, 'El cormorán grande (Phalacrocorax carbo) es una especie de ave suliforme de la familia Phalacrocoracidae de distribución casi mundial. Habita en Eurasia, África, Australasia y las costas atlánticas de Norteamérica, donde vive en cualquier extensión grande de agua, como lagos, ríos, estuarios y aguas costeras e incluyendo los embalses.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(6, 'Polla de agua', 'Gallinula chloropus', 2, 'Es una especie inconfundible en su entorno. Es una rállida de tamaño medio, que mide entre 30 y 38 cm y tiene una envergadura alar de 50 a 62 cm. Su peso puede oscilar entre 192 y 500 g. La coloración general de su plumaje es gris negruzca, con la cabeza y el cuello más oscuros, salvo la zona bajo la cola que es blanca, y sendas franjas también blancas que atraviesan transversalmente sus flancos. Su pico es rojo, al igual que el escudo facial, excepto en la punta que es amarilla. Su escudo facial es redondeado en la parte superior mientras que sus laterales son rectos y bastante paralelos, comparándolo con el escudo frontal de las gallinetas americanas que se estrecha más al juntarse con el pico y tiene la parte superior más recta. Sus patas son de color amarillo verdoso, con una mancha roja en las rodillas. Tienen unos dedos muy largos que carecen de los lóbulos de las fochas y cualquier membrana interdigital, adaptados para andar sobre la vegetación acuática. Los juveniles son de tonos parduzcos y carecen del escudo facial rojo.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(7, 'Martinete común', 'Nycticorax nycticorax', 2, 'Además de martinete común que es el nombre que recibe en España, también es llamado con otros nombres comunes a lo largo de su distribución americana como: garza bruja (Argentina), huairavo (Chile), guaco (Colombia y Venezuela), huaco, cuaco, wacana, garza nocturna coroninegra; pedrete corona negra y pedrete gris (México), chocuaco y martinete capinegro (Costa Rica), rey congo cabeza negra (República Dominicana), guanabá de la Florida (Cuba) y gauda (Chiloé).', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(8, 'Cigüeña ', 'Ciconia ciconia', 2, 'La cigüeña blanca (Ciconia ciconia) es una especie de ave Ciconiiforme de gran tamaño, perteneciente a la familia Ciconiidae. Su plumaje es mayoritariamente blanco con negro en las alas, y las patas y el pico de los adultos adquieren un color rojo. Mide un promedio de 100 y 115 cm desde la punta del pico hasta el final de la cola, y sus alas pueden llegar a tener una envergadura entre 155 y 215 cm. Las dos subespecies, que son ligeramente diferentes por su tamaño, se aparean en Europa, el noreste y sur de África y el sudoeste de Asia. El 25% de la población mundial está concentrada en Polonia.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(9, 'Rata de agua', 'Arvicola sapidus', 3, 'La rata de agua (Arvicola sapidus) es una especie de roedor de la familia Cricetidae. Es un gran cricétido anfibio de gran parte de Francia, España y Portugal. Aunque históricamente considerado un miembro de la misma especie que Arvicola amphibius, Musser y Carleton (2005) consideran que son distintos. Está listado en la Lista Roja IUCN como vulnerable debido a muchas de las mismas razones que para la rata de agua norteña.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(10, 'Jabalí', 'Sus scrofa', 3, 'El jabalí (Sus scrofa) es un mamífero artiodáctilo de la familia de los suidos. Su distribución original se corresponde con gran parte de Eurasia y algunas zonas del norte de África, si bien ha sido introducido por el hombre en América y Oceanía. Está incluido en la lista 100 de las especies exóticas invasoras más dañinas del mundo de la Unión Internacional para la Conservación de la Naturaleza.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(11, 'Black bass', 'Micropterus salmoides', 4, 'Micropterus salmoides (perca atruchada, perca americana, huro, lobina negra, lobina o black bass) es una especie de pez perciforme de la familia Centrarchidae. Es de agua dulce y se caracteriza por tener una aleta dorsal radiada espinoforme y una posterior flexible separada por una muesca. Esta especie es originaria de Norteamérica. A partir del siglo XX, esta especie se ha introducido en España, donde se considera invasora, y en otras partes del mundo.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(12, 'Tenca', 'Tinca tinca ', 4, 'La tenca (Tinca tinca) es un pez dulceacuícola situado taxonómicamente en el orden Cypriniformes y en la familia Cyprinidae, siendo la única especie del género Tinca. Excepcionalmente puede llegar a vivir hasta 20 años y pesar 3,5 o 4 kg,. El tamaño medio de los ejemplares es de 25 a 30 cm aunque se han encontrado ejemplares cercanos al metro de largo. Su cuerpo es alargado y el pedúnculo caudal corto y alto. La coloración varia de verdosa a parda dependiendo del medio en que viva. La textura del tegumento es mucosa más que escamosa.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(13, 'Boga', 'Pseudochondrostoma polylepis', 4, 'La boga de río conocida también por el nombre científico de Pseudochondrostoma polylepis pertenece a la familia de los ciprínidos (cyprinidae).', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(14, 'Pez gato', 'Siluriformes', 4, 'Los peces gatos son un grupo variado de peces denominados por sus tentáculos o barbillas prominentes, que dan la imagen de los bigotes de un gato. Son encontrados principalmente en entornos de agua dulce de todo tipo, con especies en todos los continentes, excepto en la Antártida. Algunas especies de las familias Ariidae y Plotosidae también se encuentran en hábitats marinos.\r\n\r\nHay tipos de especies muy blindadas y también especies desnudas, sin embargo, no tienen escamas. No todas las familias de peces gatos tienen tentáculos prominentes; lo que define a un pez en el orden Siluriformes son ciertas características del cráneo y vejiga natatoria.', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(15, 'Sapo de Surinam', 'Pipa Pipa', 1, 'El sapo de Surinam (Pipa pipa), también conocido como cururú, aparo, rana de celdillas, rana tablacha, sapo chola, o sapo de celdas, es un anfibio anuro que habita en regiones tropicales y subtropicales de Sudamérica y en la Isla Trinidad. Tiene el cuerpo achatado y la cabeza plana y triangular. Es de color gris verdoso con la parte inferior del cuerpo de un tono más pálido. Vive en pantanos, marismas, aguas turbias y fangosas. Está altamente adaptado a una vida acuática. Posee extremidades traseras poderosas que le ayudan a nadar y es una especie relativamente común.', 1, ),
(16, 'Rana peluda', 'Trichobatrachus robustus', 1, 'La rana peluda (Trichobatrachus robustus) es una especie de anuro de la familia Arthroleptidae. Es una especie monotípica dentro del género Trichobatrachus. El color de la rana peluda es marrón o sepia, con una oscura y ancha franja en el dorso. La zona del vientre es gris, tienen machas negras en las cuatro patas, y las puntas de los dedos son oscuras. En la cabeza tiene unas rayas negras detrás de los ojos y entre ellos.', 2, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(17, 'Sapo común ', ' Bufo bufo', 1, 'El sapo común (Bufo bufo) o sapo europeo es una especie de anfibio anuro de la familia Bufonidae muy habitual en toda clase de hábitats europeos, sobre todo en aguas estancadas: balsas de riego, albercas, etc, al ser más resistente a las aguas insalubres que otras especies de anfibios durante la fase de renacuajo.\r\nEs una especie de un grupo de ellas estrechamente relacionadas, que descienden de una línea ancestral común y que forman un complejo de especies. El sapo es un animal poco visible, ya que por lo general se esconde durante el día. Se activa al atardecer y caza de noche los invertebrados de que se alimenta principalmente. Se mueve con un paso lento y torpe o a saltos cortos; tiene la piel de color marrón grisáceo, cubierta de protuberancias parecidas a verrugas.\r\n', 1, );
INSERT INTO `animales` (`idanimal`, `nombrecomun`, `nombrecientifico`, `idcategoria`, `resumen`, `codusuario`, `foto`) VALUES
(18, 'Anfiumas', 'Amphiuma', 1, 'Las anfiumas (Amphiuma) son un claro compuesto por 3 especies de anfibios caudados endémicos del sudeste de los Estados Unidos. Es el único género de la familia Amphiumidae. Exhiben un estilo de vida completamente acuático, un cuerpo alargado (que puede exceder el metro de largo), extremidades muy reducidas, la presencia de una de las tres hendiduras branquiales del estado larval y la ausencia de párpados.? A pesar de poseer hendiduras branquiales, los adultos carecen de agallas, presentando una respiración pulmonar. Las especies se diferencian por el número de dígitos que poseen en las extremidades, variando desde uno (A. pholeter), a dos (A. means) o tres (A. tridactylum).? Exhiben, además, hábitos nocturnos, siendo depredadores generalistas.', 1, );

