INSERT INTO `descripciones` (`idanimal`, `titulo1`, `descripcion1`, `titulo2`, `descripcion2`, `titulo3`, `descripcion3`, `titulo4`, `descripcion4`, `titulo5`, `descripcion5`) VALUES
(1, 'Distribución', 'El límite de distribución septentrional no está claro. Se ha constatado la presencia de la especie hasta las cercanías de Lyon por el este y hasta el departamento de Vandea, por el oeste. Tampoco se conoce el límite en la parte central de la distribución francesa, donde es posible que se encuentre al sur de la cuenca del río Loira. Hacia el sur la especie no sobrepasa el estrecho de Gibraltar, no apareciendo en el África continental.\r\n<br>\r\nHa sido introducida en las Islas Baleares (Mallorca, Menorca, Ibiza y Formentera), Canarias (excepto en El Hierro y Lanzarote), Azores y Madeira.', 'Reproducción', 'El periodo reproductor abarca desde abril hasta julio, teniendo lugar principalmente en masas de agua permanentes. Los adultos seleccionan negativamente como hábitat reproductores ambientes con poco recubrimiento de vegetación de ribera. El amplexo es axilar. Los machos alcanzan la madurez sexual a los dos años de edad y las hembras al año. Se han relacionado con el cortejo dos formas de canto de los numerosos que emiten los machos. Otros se relacionan con la defensa de pequeños territorios.\r\n<br>\r\nLas hembras pueden desovar entre 2000 y 7000 huevos, con una media de unos 2300, que suelen adherirse a la vegetación y al sustrato, pero también pueden encontrarse flotando en el agua. Emergen del huevo en cinco a ocho días y la metamorfosis comienza en ocho a doce semanas, aunque algunos renacuajos pueden pasar el invierno en ese estadio.', 'Alimentación', 'Se alimentan tanto de presas terrestres como acuáticas, aunque mucho más frecuentemente de las primeras. Fundamentalmente se alimentan de invertebrados, sobre todo dípteros (moscas y mosquitos), coleópteros (escarabajos) e himenópteros (abejas, avispas y hormigas). De forma ocasional se puede alimentar de pequeños vertebrados, como peces, aves, anfibios y reptiles. También puede practicar el canibalismo con ejemplares más pequeños y renacuajos.', 'Comportamiento', 'En las zonas más frías pueden presentar una reducción metabólica invernal de duración variable, pero en la mayoría de las zonas que ocupan se las puede encontrar activas durante todo el año. Son tanto diurnas como nocturnas, decreciendo su actividad en las horas de mayor insolación durante el verano.\r\n<br>\r\nLos ejemplares subadultos ocupan con mayor frecuencia masas de agua temporales de escasa profundidad y arroyos con corriente rápida, donde no suelen encontrarse adultos. Los juveniles ocupan espacios sin depredadores. Comparte hábitat con otras especies de anfibios de hábitos terrestres cuando éstas acuden a las masas de agua a reproducirse.', '', ''),
(2, 'Características', 'Sapo de entre 5 y 6 cm de longitud, con máximos en las hembras de 9,5 cm y en los machos de 9 cm. Muy raramente alcanzan los 12 cm. Las tallas de las poblaciones ibéricas son algo mayores que las centroeuropeas, a excepción de la población de Doñana donde se observa un fenómeno de enanismo.\r\n\r\nEs de aspecto robusto, con las pupilas horizontales, el iris verdoso y las glándulas parotídeas muy marcadas y paralelas. Poseen una línea vertebral amarilla o verdosa clara muy conspicua característica de la especie y que se aprecia ya en los renacuajos recién metamorfoseados. Las patas posteriores son cortas y robustas adaptadas a la marcha y no al salto. Dorso con manchas verdes de contorno no bien definido sobre fondo ocre mostrando un diseño de «camuflaje».\r\n\r\nLos renacuajos nacen con 0,35 cm y alcanzan los 3 cm al final de su desarrollo. Tras la metamorfosis su longitud merma hasta los 1,3 cm, momento en el que abandonan el agua, pudiendo ser menores si la charca se deseca antes. Son de color negro por el dorso y grisáceos por el vientre, con manchas blanquecinas al final del desarrollo debido a la transparencia de los intestinos. El espiráculo es recto, dirigido hacia atrás y se encuentra en el lado izquierdo. La distancia entre los ojos es el doble que la distancia entre las narinas. La segunda serie de dientes labiales superiores poseen un diastema central ancho. La cola es redondeada.', 'Ciclo de vida', 'Vive más de 12 años y se alimenta de insectos y otros invertebrados. De noche se mueve a lo largo de terrenos abiertos con vegetación; recorre considerables distancias cada noche, posibilitando a la especie la colonización de nuevos hábitats muy rápidamente.\r\n\r\nSu llamada de apareamiento es muy fuerte y distintiva que se repite sin descanso, amplificada por el saco vocal bajo el mentón, que les permite reunirse a pesar de encontrarse en poblaciones pequeñas. Además poseen un grito de suelta que se emplea entre machos que se han acoplado por error.\r\n\r\nEn la península ibérica, su fenología reproductiva es muy amplia, dependiendo de los periodos de lluvia. Así, puede comenzar en otoño en levante y terminar en junio en las poblaciones del centro peninsular en altitudes por encima de los 1000 m. En el resto de su zona de distribución se reproducen desde finales de abril a julio, con acoplamiento axilar. Cada hembra puede depositar varios miles de huevos, formando «ristras» en charcas. La puesta en la charca necesita tener un ligero gradiente de profundidad, con vegetación rala en las orillas y en el agua. Frecuentemente son charcas temporales, a veces tan efímeras como roderas de vehículos, y en ocasiones las larvas mueren cuando aquellas se secan. Este riesgo se compensa con el dilatado periodo de apareamiento realizado por distintos individuos, de forma que se pueden encontrar juveniles en septiembre con uno o cuatro meses de edad.', 'Hábitat', 'De hábitos terrestres ocupa casi cualquier hábitat, evitando las regiones eurosiberianas más húmedas y los bosques densos con abundante sotobosque. Requiere de charcas someras o temporales para reproducirse.\r\n\r\nSe distribuye por Europa Occidental, Central, Islas Británicas y Escandinavia, desde Portugal a los países bálticos. En la península ibérica falta en la línea costera cantábrica (Cantabria y Asturias) y en algunas zonas de Pirineos, Aragón y Extremadura. Desde el nivel del mar hasta los 2500 m de altitud.', '', '', '', ''),
(3, 'Identificación', 'Es un urodelo de pequeño tamaño que puede alcanzar hasta 97 mm de longitud total. Los machos no desarrollan cresta dorsal, sino sólo una cresta caudal baja durante el periodo de celo. La cola, de similar longitud al cuerpo, está comprimida lateralmente, y en los machos acaba en un pequeñísimo filamento. La coloración de cabeza y dorso es de color pardo o marrón, y ventralmente es de color naranja o rojizo, sobre el que destacan conspicuas manchas o puntos gruesos negros, irregularmente dispuestos, pero frecuentemente alineados lateralmente.\r\n\r\nLos renacuajos miden entre 10 y 18 mm, y son de color amarillento con un leve diseño punteado en oscuro y presenta una cresta dorsal que se continúa hasta el final de la cola, donde acaba en ángulo agudo.', 'Distribución', 'Es un endemismo ibérico distribuido por la mitad occidental de la Península Ibérica. Su distribución incluye localidades desde escasa altitud y muy próximas al mar (como ocurre en el área de Doñana) hasta zonas montañosas (hasta aprox. 1.800 msnm), encontrándose preferentemente en zonas entre 400 y 1.000 msnm. El clima que caracteriza a la mayoría de sus hábitats es de carácter mediterráneo oceánico y continental, con precipitaciones anuales normalmente inferiores a 900 mm, aunque en el norte es también abundante en zonas de clima templado frío oceánico, con mayor abundancia de precipitaciones.', 'Reproducción', 'En el sur, los adultos acuden a los medios acuáticos para reproducirse en otoño, manteniéndose la época de cortejos y ovoposición durante el invierno. Los renacuajos se observan de febrero a junio, completando la metamorfosis los primeros individuos en mayo. En otras zonas del centro y norte de su área de distribución, los adultos comienzan la reproducción en febrero, prolongándose hasta julio. Los primeros renacuajos se observan en primavera, y completan su metamorfosis de julio a septiembre.', '', '', '', ''),
(4, 'Características', 'Posee una cabeza grande, ancha en la parte posterior, con ojos pequeños, que se vuelven saltones hacia arriba cuando la aplasta hasta convertirla en apenas un disco semicircular.\r\n\r\nEl cuerpo se halla cubierto por verrugas de punta negra y su coloración varía del prácticamente negro al amarillo pálido, aunque suele ser gris pardusca con manchas oscuras y un color más claro en la parte ventral.\r\n\r\nLa cola, comprimida lateralmente, suele mostrar la misma coloración que el resto del cuerpo con bandas anaranjadas ocasionalmente en los bordes superior e inferior.\r\n\r\nEn cada costado se hace visible una hilera de 7 a 10 manchas anaranjadas que coinciden con los extremos de las costillas y por donde, en ocasiones, asoman los extremos de éstas, considerado este hecho como un mecanismo de defensa por diversos autores. Este mecanismo podría ser considerado como un primitivo y rudimentario sistema de inoculación, aunque es totalmente inofensivo para el hombre.', 'Hábitos', 'Son animales que pasan casi todo el tiempo dentro del agua, de la que salen raramente, algo más los juveniles, de noche o cuando el tiempo es húmedo. Nadan con agilidad y fuerza. Se encuentran en arroyos, riachuelos de curso lento y también tanques, cisternas y charcas más o menos permanentes.\r\n\r\nSon carnívoros, como los otros anfibios, alimentándose de pequeños animales acuáticos, sobre todo larvas de insectos, renacuajos, sanguijuelas. Arrojan sus fauces abiertas sobre cualquier cosa que se mueva, lo que termina dando lugar a frecuentes casos de canibalismo.\r\n\r\nRealizan el cortejo bajo el agua y la hembra pone entre 300 y 1.000 huevos. Los va fijando uno por uno a las hojas de plantas acuáticas, utilizando un moco adhesivo para enrollar la hoja alrededor del huevo.', 'Vida en cautiverio', 'Esta especie de tritón en cautiverio, presenta un comportamiento tranquilo, pasando la mayor parte del tiempo oculto. En cuanto a su alimentación puede ser variada, pueden consumir pellets para peces, lombrices o tubifex sin problemas. Al momento de alimentarse son particularmente voraces, reaccionan inmediatamente ante la presencia de alimento. En cuanto a la reproducción, para que la misma tenga éxito, debe existir un período de hibernación donde el agua del acuario se encuentre a 10ºC durante al menos un mes. De no ser así, los gallipatos realizarán todo el cortejo pero las hembras no desovarán. Un dato interesante es que pueden realizar el cortejo en repetidas ocasiones y durante varios años sin que exista ni una sola puesta. Cuando se dan las condiciones propicias y ocurre el desove, lo conveniente es separar los huevos de sus progenitores para que no sean devorados. Las condiciones óptimas para la vida en cautiverio de esta especie son sencillas. Se necesita un acuario o acuaterrario de al menos 20 litros por pareja. El sustrato puede ser desde arena hasta piedras medianas, cuidando que no sean muy pequeñas para evitar la ingestión junto con el alimento.', '', '', '', ''),
(5, 'Características', 'El cormorán grande es un ave negra de gran tamaño con una gran variación de talla entre las subespecies de su amplia área de distribución. Su peso oscila entre 1,5 kg y los 5,3 kg. Los machos suelen ser mayores y más pesados que las hembras, siendo la los de las subespecie nominal (P. c. carbo) un 10% de media que los de la subespecie más pequeña de Europa (P. c. sinensis). La longitud pude variar de los 70 a 102 cm y su envergadura alar oscila entre los 121 y 160 cm. Es considerado el segundo cormorán vivo más grande, después del cormorán mancón, aunque el cormorán japonés está próximo con una talla similar\r\nTiene una cola bastante larga y una garganta amarillenta. Los adultos lucen manchas blancas en las caderas y la garganta durante la estación de cría. En Europa se puede distinguir de su pariente el cormorán moñudo (Phalacrocorax aristotelis) por su mayor tamaño, constitución más robusta, pico más grueso, y carecer de cresta y cualquier tono verdoso en su plumaje. La cola del cormorán moñudo tiene 12 réctrices, la del cormorán grande 14. El final de la mandíbula inferior del pico acaba antes que el ojo y en el cormorán grande acaba después del ojo. En Norteamérica se distingue del cormorán orejudo (Phalacrocorax auritus) también porque es más grande y pesado y la garganta y el pico de este último tienen un color amarillo más intenso, y carece de las manchas blancas en las caderas. Los cormoranes grandes son aves bastante silenciosas, pero emiten varios tipos de sonidos guturales en sus colonias de cría.', 'Taxonomía', 'El cormorán grande se clasifica en el género Phalacrocorax, perteneciente a la familia de los cormoranes, Phalacrocoracidae. Los cormoranes forman parte del orden Suliformes, como una de sus cuatro familias, junto a Sulidae (alcatraces y piqueros), Fregatidae (fragatas) y Anhingidae (añingas). Los suliformes son aves acuáticas pescadoras que hasta 2010 se clasificaban en Pelecaniformes.\r\nEl cormorán grande fue una de las muchas aves descritas científicamente por Carlos Linneo en su obra Systema naturæ de 1758, con el nombre de Pelecanus carbo. En 1760 fue trasladado como especie tipo al género Phalacrocorax, creado por el zoólogo francés Mathurin Jacques Brisson.', 'Comportamiento', 'Los cormoranes grandes anidan principalmente en la costa, anidando en los acantilados o los árboles (que en ocasiones matan con sus deposiciones), pero también se reproducen en humedales del interior. Suelen poner tres o cuatro huevos en un nido hecho con algas y ramas.\nEminentemente piscívoro, se alimenta de un amplio abanico de especies, entre ellas las anguilas, que ocupan una parte considerable en su dieta en áreas donde está presente. Nada con su cuerpo sobresaliendo poco del agua, atisbando con frecuencia bajo la superficie para localizar peces. Depreda sobre las especies más nadadoras y diurnas, a las que persigue nadando o, más frecuentemente, buceando. Puede bucear a profundidades considerables, pero no suele alejarse de la costa. Permanece sumergido una media de 20-30 segundos. Devora sus capturas en la superficie. A veces cooperan varios individuos para acorralar conjuntamente a sus presas.', '', '', '', ''),
(6, 'Características', 'La gallineta común es la especie tipo del género Gallinula, que pertenece a la familia Rallidae, una familia de aves acuáticas y semiacuáticas de tamaño medio, aunque pequeñas en comparación con el resto de Gruiformes. Las rállidas suelen tener el cuello relativamente largo, la cola corta, robustas patas con dedos largos y plumajes discretos en contraste con sus coloridos picos y escudos frontales.\r\nLa gallineta común fue descrita científicamente por Carlos Linneo en 1758 en la décima edición de su obra Systema naturae, con el nombre científico, Fulica chloropus. En 1760 fue trasladada al género Gallinula creado por el zoólogo francés Mathurin Jacques Brisson. Gallinula en latín es el diminutivo de «gallina», mientras que chloropus procede de la combinación de las palabras griegas: ?????? (khl?ros) «amarillo verdoso» y ???? (pous) «pie».', 'Comportamiento', 'Habita y se reproduce en ambientes de marisma y ríos y lagos con abundante vegetación de Eurasia y África. Las poblaciones del norte donde el agua se congela, migran hacia climas más templados. A pesar de la pérdida de sus hábitats, esta ave es todavía común y ampliamente distribuida. Globalmente la gallineta común es una especie abundante clasificada como especie bajo preocupación menor por la UICN.\r\nConsume una amplia variedad de vegetales y pequeños animales acuáticos. Busca alimento tanto alrededor del agua como en ella, caminando sobre los nenúfares y otra vegetación flotante o sumergiendo medio cuerpo mientras nadan. Suelen ser asustadizas aunque se pueden volver confiadas en algunas zonas.\r\nDurante la época de cría son territoriales. Anidan habitualmente en el suelo junto al agua entre la vegetación densa. La puesta empieza en primavera, entre marzo y mayo en las regiones templadas del hemisferio norte. La primera puesta suele constar de uno 8 huevos, su realiza una segunda la hembra pone de 4 a 8 huevos. La incubación dura aproximadamente tres semanas. Ambos progenitores incuban y alimentan a los polluelos. Los nidos pueden ser reutilizados por varias hembras. Los polluelos tardan entre 40–50 días, y unas semanas después se vuelven independientes para criar su propia nidada al año siguiente. Cuando están amenazados los polluelos pequeños pueden subirse a la espalda de los adultos que volarán acarreándolos hasta ponerse a salvo.', '', '', '', '', '', ''),
(7, 'Descripción', 'Es una garza rechoncha y de tamaño medio (entre 60 y 65 cm). Es notable la escasa longitud de su cuello, si lo comparamos con el de otras garzas, como la garza real o la garceta común. Se caracteriza por sus ojos de color rojo intenso. El plumaje de las partes inferiores es principalmente blanquecino grisáceo. El cuello puede ser blanco o gris claro. El rostro, garganta y vientre son de color blanco puro. El píleo y nuca y espalda son de color negruzco, aunque de tonalidad cambiante, y las alas son de color gris. A los adultos les salen de la nuca dos o tres plumas blancas largas y estrechas, algo más largas en el macho que en la hembra.\r\nLas patas y pies son de color amarillo pálido (algo más intenso en época de cría). El pico, robusto pero no excesivamente largo, es verdoso en la base y negro en la parte superior.\r\nLos juveniles muestran un plumaje veteado en marrón y blanco, así como ojos de color miel o amarillos. No presentan las plumas de la nuca hasta el primer año de vida.\r\nEs un ave de costumbres eminentemente crepusculares y nocturnas, aunque en época de cría es posible verla en actividad a la luz del día.', 'Taxonomía y etimología', 'El martinete común es la especie tipo del género Nycticorax, perteneciente a la familia de las garzas, Ardeidae. A su vez, las garzas se clasifican en el orden Pelecaniformes, junto a otras cuatro familias de aves acuáticas: Pelecanidae (pelícanos), Threskiornithidae (ibis y espátulas), Balaenicipitidae (picozapato) y Scopidae (ave martillo).\r\nEl martinete común fue descrito científicamente por Carlos Linneo en 1758, en la décima edición de su obra Systema naturae, con el nombre científico de Ardea Nycticorax, que significa «garza cuervo nocturno». En 1828, el naturalista inglés Thomas Ignatius Maria Forster lo trasladó al género Nycticorax. El nombre de su género y especie procede de la combinación de las palabras griegas nyktos (noche) y korax (cuervo). Hace referencia a sus hábitos nocturnos y sus graznidos, similares a los del cuervo.', 'Alimentación', 'Se alimenta principalmente de peces, anfibios, pequeños reptiles e insectos. Excepcionalmente puede completar su dieta con algún ratón.', 'Reproducción', 'Los martinetes llegan a sus zonas de nidificación en marzo. Los machos comienzan el complejo ritual de selección de pareja antes de la construcción del nido. Una vez establecida la pareja, se construye el nido sobre un árbol o un matorral alto a unos 4 o 5 metros de altura. El nido es una sencilla estructura de palos, ramas y otros elementos.\r\nLa puesta se realiza entre mayo y junio, y consiste en 3 o 4 huevos de un pálido verde azulado. La incubación, en la que se alternan el macho y la hembra, dura unos 20-21 días. Una vez eclosionados los huevos, ambos progenitores alimentan a los pollos, que permanecerán en el nido 3 o 4 semanas, aunque volverán a él para dormir.', '', ''),
(8, 'Características', 'Es un ave muy grande; una cigüeña adulta puede alcanzar una longitud de 100–115 cm,nb y una altura de pie de 100–125 cm. Puede alcanzar una envergadura alar de 155–215 cm y un peso de 2,3–4,5 kg. Como todas las cigüeñas, tiene patas largas, un cuello largo y un largo pico recto y puntiagudo. Ambos sexos tienen una apariencia idéntica, aunque los machos suelen ser más grandes que las hembras. Posee un plumaje principalmente blanco, con negro en las plumas de vuelo y las coberteras de las alas; el color negro se debe al pigmento melanina. Las plumas del pecho son largas y peludas, formando un collar que se utiliza en algunas exhibiciones de cortejo. El iris es marrón o gris, y la piel peri-orbital es de color negro. El ave adulta tiene un pico rojo brillante y patas rojas, cuya coloración se deriva de los carotenoides en su alimentación. Estudios demostraron que en algunas partes de España el pigmento se basa en astaxantina procedente de una especie de cangrejo de río introducida (Procambarus clarkii), y los colores brillantes rojos del pico aparecen incluso en los pichones, en contraste con los colores más apagados de los picos de cigüeñas blancas juveniles en otros lugares.\r\nAl igual que otras cigüeñas, las alas son largas y anchas y permiten al ave de planear. El aleteo es lento y regular. Vuela con el cuello estirado hacia delante y con sus largas piernas extendiéndose más allá del borde de su cola corta. Camina a un ritmo lento y constante con el cuello estirado. En contraste, a menudo retrae su cabeza entre sus hombros cuando descansa. La muda no ha sido estudiada de forma exhaustiva, pero parece ocurrir durante todo el año, aunque las plumas de vuelo primarias son sustituidas durante la temporada de cría.', 'Migración', 'El estudio sistemático de la migración comenzó con el ornitólogo alemán Johannes Thienemann quien dio inicio a investigaciones de anillamiento en 1906 en el observatorio de aves de Rossitten en el istmo de Curlandia, en lo que entonces era Prusia Oriental. Aunque Rossitten en si no tenía una gran concentración de cigüeñas, el observatorio coordinó el anillamiento a gran escala de la especie en Alemania y en otras partes de Europa. Entre 1906 y la Segunda Guerra Mundial se anillaron alrededor de cien mil cigüeñas blancas, principalmente aves juveniles, de las cuales más de dos mil fueron recuperados a largas distancias entre 1908 y 1954.\r\nEn agosto y septiembre las cigüeñas blancas abandonan las zonas de anidación en Europa y vuelan hacia el sur en dirección de África. Allí pasan el invierno en las sabanas desde Kenia y Uganda hacia el sur hasta la provincia del Cabo en Sudáfrica. En estas zonas se congregan en grandes bandadas que pueden exceder mil aves. Algunos divergen hacia el occidente, hasta el oeste de Sudán y Chad, e incluso hasta Nigeria. En la primavera las aves regresan al norte, pasando por Sudán y Egipto entre febrero y abril. Llegan en Europa en torno a finales de marzo y abril, después de un viaje que dura en promedio 49 días. En comparación, el viaje de otoño se completa en aproximadamente 26 días. La presencia de vientos de cola y la escasez de alimentos y de agua a lo largo de la ruta –aves suelen sobrevolar con mayor velocidad las regiones que carecen de recursos– aumentan la velocidad promedio de viaje.', 'Reproducción', 'La cigüeña blanca se reproduce en zonas agrícolas abiertas con acceso a humedales pantanosas; construye un nido grande en la cima de árboles, edificios, o en plataformas artificiales levantadas específicamente para este propósito. El nido se construye de ramas y palos, y tiene un diámetro de 0,8–1,5 m, una profundidad de 1–2 m, y pesa entre 60 y 250 kg. A menudo los nidos se construyen en colonias cuya composición puede variar a lo largo de los años. Como fueron considerados un buen augurio, las cigüeñas no fueron perseguidas y a menudo anidan cerca de asentamientos humanos; en el sur de Europa, se puede observar nidos de cigüenãs en los campanarios de iglesias y en otros edificios. El nido suele ser utilizado año tras año, sobre todo por los machos mayores. Los machos llegan a principios de la temporada de cría y eligen los nidos. Los nidos más grandes son asociados con un mayor éxito en la cría, y parecen ser buscados. El cambio de nido es a menudo relacionado con un cambio en la composición de la pareja, y la falta de éxito en la cría en el año anterior; las aves más jóvenes son más propensas a cambiar de sitio de anidación. La composición de la pareja puede cambiar varias veces durante la primera fase de la temporada reproductiva, y la cría sólo comenzará después de que se haya establecido un apareamiento estable.\r\nVarias especies de aves suelen anidar en los grandes nidos de la cigüeña blanca. Ocupantes regulares incluyen el gorrión común, gorrión molinero, y estornino pinto; residentes menos comunes incluyen el cernícalo vulgar, mochuelo europeo, carraca europea, lavandera blanca, colirrojo tizón, grajilla, y gorrión moruno. Las cigüeñas blancas emparejadas se saludan con una exhibición del comportamiento arriba-abajo, sacudiendo la cabeza agachándose, y crotoreando mientras lanzan la cabeza hacia atrás. Las parejas copulan frecuentemente durante el mes que precede la puesta. En el mundo animal, una alta frecuencia de cópulación entre parejas es generalmente asociada con competencia espermática y una alta frecuencia de copulación extrapareja; sin embargo, la copulación extrapareja no es un comportamiento común de las cigüeñas blancas.', '', '', '', ''),
(9, 'Alimentación', 'Se alimenta principalmente de plantas, aunque tal vez sería más correcto el uso del término fitófago. En la práctica muchos animales principalmente herbívoros también se alimentan de proteínas animales, como insectos, huevos, etc. En la cadena trófica, los herbívoros son los consumidores primarios, mientras que los que se alimentan de carne son consumidores secundarios. Las personas que no comen carne no son considerados herbívoros, sino vegetarianos.', 'Reproducción', 'Las hembras pueden parir hasta 5 veces al año, aunque lo normal son 2. La gestación dura 21 o 22 días y suelen tener de 2 a 7 crías por parto. La madurez sexual se alcanza en un poco más de un mes. La longevidad de esta especie es de 2 años.', 'Distribución', 'Esta especie está presente en Francia, España y en Portugal. Tras la amenaza de desaparición a corto plazo, se emprendieron algunos esfuerzos para salvarlo, que fueron desde campaña de información y sensibilización del público a cambios en las obras públicas que afectan al hábitat de la rata anfibia y a la conservación de su hábitat.', 'Uso', 'En el delta del Ebro antiguamente se les llamaba taus, y eran cazadas por su carne. Al ser un roedor que se alimenta de cereales es bueno para comer.', '', ''),
(10, 'Características', 'El jabalí es un mamífero de tamaño mediano provisto de una cabeza grande y alargada, en la que destacan unos ojos muy pequeños. El cuello es grueso y las patas son muy cortas, lo que acentúa aún más su rechoncho cuerpo, en el que es mayor la altura de los cuartos delanteros que los traseros, a diferencia del cerdo doméstico, que por evolución genética ha desarrollado más la parte posterior de su cuerpo, donde se localizan las piezas que alcanzan más valor en el mercado de las carnes.\r\nEl jabalí compensa su mala vista con un importante desarrollo del olfato, que le permite detectar alimento, como trufas, bellotas, setas, caracoles, vegetales y animales bajo tierra, o incluso enemigos a más de 100 metros de distancia. El oído está también muy desarrollado y puede captar sonidos imperceptibles para el ser humano.\r\nSus pelos son gruesos y negros midiendo entre 10 y 13 cm en la cruz y unos 16 cm en la punta de la cola. El color de la capa o pelo es muy variable y va desde colores grisáceos a negro oscuro, pasando por colores rojizos y marrones. Las patas y el contorno del hocico son más negras que el resto del cuerpo. La crin que recorre el lomo a partir de la frente, se eriza en caso de cólera. El cambio de pelo tiene lugar hacia mayo o junio, aunque la hembra con crías muda más tarde. En verano, las cerdas son más cortas.', 'Las crías', 'Las crías o jabatos nacen con unas características rayas longitudinales a lo largo del cuerpo, lo que les ha dado el nombre de rayones o listones. Estas desaparecen a lo largo de los primeros meses de vida y su pelaje se oscurece, pasando del rojo bermejo al año de edad y al marrón o negro en los ejemplares adultos.', 'Hábitat', 'El jabalí se adapta a todo tipo de hábitats siempre que disponga de una mínima cobertura y alimento (acuden mucho a los chaparros por la bellota), aunque prefiere los lugares con una vegetación alta donde poder camuflarse (carrasca, aulagas, junqueras, espinos...), y donde abunde el agua (para beber, revolcarse en el lodo o el barro y regular su temperatura). Sus hábitats predilectos son los encinares y los macizos forestales caducifolios o mixtos, sobre todo si están poco visitados y su nivel inferior es rico en maleza, zarzas y espinos donde pueda revolcarse en seco y al abrigo del viento. Pero también se le encuentra en el matorral mediterráneo (maquia) y marismas, sin desdeñar las áreas de cultivo, siempre que mantengan una mínima cobertura de arbolado o arbustos donde protegerse. En caso necesario, nada bien y durante mucho tiempo. Soporta fácilmente los rigores del invierno gracias a su pelaje y dura capa de piel lo que le permite permanecer en invierno en la zona de alta-media montaña sin mayores problemas que los derivados de la falta de alimentos.', 'Gastronomía', 'Es muy típico su consumo en la cocina tradicional española. En la Patagonia argentina suele también servirse como un plato típico de la región. Sin olvidar que es un plato típico en las regiones de alta montaña, como en los Pirineos, donde abundan los jabalíes y donde se crean unos estofados con una salsa característica.', '', ''),
(15, 'Morfología', 'La rana común de celdilas, con un tamaño de 12 a 20 cm, tiene una cabeza triangular, ojos grandes con pupilas redondeadas, y las narinas al final de dos tubos estrechos en el hocico. El cuerpo es plano, de color marrón o verde oliva, y cubierto por muchos tubérculos dándole el aspecto general de una hoja muerta. Las extremidades anteriores son cortas y débiles y las extremidades posteriores son largas, fuertes y palmeadas. Es totalmente acuático y vive en el fondo fangoso de los ríos tropicales, volviendo a la superficie para tomar aire, en general cada media hora. Pueden soportar por mucho tiempo la inmersión (más de una hora) sin revestimiento de aire (aparentemente por tomar el oxígeno del agua). Como los peces, que tienen sistemas de línea laterales, detectan bien los cambios de presión en el agua. Utilizan órganos táctiles en forma de estrella en la punta de sus dedos para detectar los alimentos. La Pipa pipa se lanza sobre su presa, que consiste principalmente en invertebrados, como gusanos y crustáceos. ', 'Reproducción', 'Se reproducen cuando los niveles de agua aumentan y la temperatura del agua desciende. Los machos llaman a las hembras haciendo clic bajo el agua. En este momento, los animales se vuelven muy activos y tiemblan cuando se ponen en contacto unos con otros. Los machos agarran a las hembras con sus patas traseras y nadan juntos, dando saltos mortales. Cuando la pareja llega a la superficie del agua, la hembra nada con la espalda en la superficie y deposita entre 60 y 100 huevos. Durante el proceso de apareamiento el macho fertiliza los huevos y luego los une de nuevo a la hembra. La piel de la hembra encierra los huevos fertilizados. El desarrollo larvario se produce en el huevo y los individuos ya metamorfoseados, de aproximadamente 2 cm de longitud, salen después de una incubación de 3 a 4 meses. Inicialmente, los juveniles tienen problemas para bucear y permanecer cerca de la superficie del agua. Pueden inmediatamente comenzar a comer.\r\nLa reproducción de Pipa pipa incluye el desarrollo directo de los jóvenes, sin fase larval. La hembra lleva los huevos en una estructura de nido de abeja en la espalda hasta que se completa el desarrollo y emergen como adultos en miniatura. Los huevos se adhieren a la espalda de la hembra, posiblemente debido a una secreción de la cloaca. No se pegan en el vientre del macho que se estrecha contra la hembra durante la cópula, ni a los demás huevos en la parte posterior de la hembra. \r\nEn las primeras horas después de la fecundación, los huevos se hunden en la piel de la hembra. La piel crece alrededor de los huevos, que se adjunta en un quiste con una tapa caliente. Durante el desarrollo, a los jóvenes les crece las colas temporalmente, que aparentemente son utilizadas en la captación de oxígeno. Después de 12-20 semanas, los jóvenes emergen sin cola con una forma aplanada en forma de ranas, como sus padres, salvo que tienen sólo 2 cm de longitud. Están, sin embargo, plenamente desarrollados a excepción de la bifurcación de los lóbulos de la punta de los dedos. Los jóvenes suelen salir de atrás de la hembra en el momento de la muda, es decir, cuando la madre se deshace de su piel.\r\nEl nombre vernáculo de "cururú" deriva del guaraní curú, "sarna", "lepra" y ru (de rub), "el que tiene o produce", por la creencia de que el roce con el animal produce una erupción cutánea.2pulmones pequeños y un cuerpo tan robusto como el Trichobatrachus robustus.\r\n', '', '', '', '', '', ''),
(16, 'Hábitat', 'Se encuentra en Camerún, República Democrática del Congo, Guinea Ecuatorial, Gabón, sudeste de Nigeria, norte de Angola, África y posiblemente también en la República del Congo.3Su hábitat son los bosques húmedos tropicales o subtropicales, las riberas, las tierras de labor, las plantaciones y los bosques severamente degradados. Está amenazada por la pérdida de hábitat.', 'Alimentación', 'Es un anfibio carnívoro que se alimenta de insectos y moluscos, como escarabajos, babosas, grillos o arañas.', 'Morfología y reproducción', 'Los machos son de mayor tamaño que las hembras, llegando a alcanzar los 11 cm, poseen una forma aplanada con cabeza ancha y hocico plano. Suelen vivir en tierra, regresando al agua solamente para la reproducción.\r\nLos machos poseen un saco vocal pareado y desarrollan una especie de filamentos en los costados y en las patas traseras durante la época de cría, de donde deriva su nombre.\r\nDeposita los huevos en rocas dentro de corrientes de agua. Los renacuajos poseen hileras de dientes afilados y son carnívoros.\r\nConocida comúnmente como rana peluda porque los machos en periodo de apareamiento desarrollan unos filamentos de piel, parecidos en la forma a pelos, que usan para complementar su aporte de oxígeno. El nombre científico de este particular animal es Trichobatrachus robustus. Significa "rana peluda robusta". Efectivamente, se trata de una rana de unos 11 cm de largo que tiene una complexión corpulenta y unas proyecciones en la piel que a simple vista parecen pelos. Sin embargo, estas proyecciones dérmicas, que se encuentran en los laterales de los machos en edad reproductiva, no son pelos. Son extensiones de la piel altamente vascularizadas (llenas de arterias). Sirven para aumentar la superficie dérmica en contacto con el exterior. En realidad, es una estructura que aumenta la superficie respiratoria. Eso se comprende fácilmente si recordamos que los anfibios, pese a tener pulmones, realizan una importante parte de la respiración a través de la piel, captando el oxígeno disuelto en el aire o en el agua. Fisiológicamente, realizan la misma función que las branquias externas de los renacuajos, los alevines de las ranas. Esto resulta esencial para una rana con pulmones pequeños y un cuerpo tan robusto como el Trichobatrachus robustus.\r\n', '', '', '', ''),
(17, 'Reproduccion', 'El sapo común emerge de la hibernación en primavera y se produce una migración masiva hacia los sitios de reproducción. Los sapos convergen solo en ciertas lagunas, favoreciendo la concentración y evitando al mismo tiempo otras extensiones de agua que parecen más adecuadas. Los adultos frecuentan la misma ubicación año tras año y más del 80 % de los machos marcados cuando emergieron vuelven a la misma charca en que se criaron para reproducirse. La encuentran principalmente por señales olfativas y magnéticas. Sapos experimentalmente trasladados a otro lugar y equipados con dispositivos de seguimiento se han mostrado capaces de localizar su estanque de cría original incluso cuando el desplazamiento supera los tres kilómetros.\r\n\r\nLos machos llegan primero y permanecen en el lugar durante varias semanas mientras que las hembras solo permanecen el tiempo suficiente para aparearse y desovar. En lugar de luchar por el derecho a aparearse con una hembra, los sapos machos suelen contender por medio del "canto". Croar proporciona una señal fiable del tamaño, que parece ser un factor de selección importante. Sin embargo, las peleas se producen en algunos casos. En cierto estudio en un estanque donde los machos superaron a las hembras por cuatro o cinco a uno, se encontró que 38% de los machos ganó el derecho a aparearse al derrotar a sus rivales en combate o por el desplazamiento de otros machos ya montados en alguna hembra. Los sapos macho generalmente superan en número a las hembras en los estanques de cría. Un estudio sueco encontró que la mortalidad femenina fue mayor que la masculina y que el 41 % de las hembras no acudió al estanque de cría en la primavera y perdió un año antes de volver a reproducirse.\r\n', 'Habitat', 'Se distribuye por toda Europa salvo Irlanda, Islandia y algunas islas mediterráneas, además de Asia noroccidental y pequeñas partes del noreste africano. Es uno de los anfibios más conocidos, dada su distribución y requerimientos ecológicos laxos.', 'Comportamiento', 'El sapo común por lo general se mueve caminando lentamente o en saltos cortos esporádicos que implican a las cuatro patas. Se pasa el día escondido en una guarida excavada por él mismo bajo el follaje o bajo una raíz o piedra donde su coloración hace que sea poco visible. Sale al caer el sol y puede viajar una cierta distancia en la oscuridad mientras caza. Es más activo en caso de lluvia. Al amanecer ha vuelto a su base y puede ocupar el mismo lugar durante varios meses. Es voraz y come cochinillas, babosas, escarabajos, orugas, moscas, gusanos e incluso pequeños ratones. Las presas pequeñas, de movimiento rápido, pueden ser capturadas por la lengua protráctil, mientras que las más grandes se atrapan con las mandíbulas. Al no tener dientes, la comida se ingiere a menudo entera, en una serie de tragos. El sapo no reconoce a su presa como tal, sino que trata de consumir cualquier objeto en movimiento, pequeño y oscuro que encuentre por la noche. Esto se dedujo, entre otros, de un estudio de investigación que observó que se abalanzaban sobre un pedazo de papel negro como si fuera una presa, siempre que midiera menos de 1 cm, pero pasaban por alto una pieza en movimiento más grande. Así, los sapos parecen depender fuertemente de ciertos estímulos visuales para la alimentación y pueden ver a sus presas a intensidades muy bajas de luz en que los seres humanos no perciben nada. De forma periódica, el sapo común cambia de piel; esta se va desprendiendo en jirones y se consume a continuación.\r\n\r\nCuando es atacado, el sapo común adopta una postura característica, inflando su cuerpo y elevándose, con sus cuartos traseros levantados y la cabeza baja. Su principal medio de defensa es la secreción lechosa maloliente y de sabor desagradable producida por las paratiroides y otras glándulas de su piel y que contiene una toxina llamada bufagina; suficiente para disuadir a muchos depredadores (aunque la culebra de collar parece ser inmune). Otros depredadores de sapos adultos son erizos, ratas y visones, e incluso gatos domésticos. Las aves que se alimentan de sapos incluyen garzas, cuervos y aves rapaces. Se ha observado a cuervos punzar la piel con su pico y luego extraer el hígado del animal, evitando así la toxina. Los renacuajos también exudan sustancias nocivas que disuaden a los peces de comérselos, aunque no al tritón crestado. Entre los invertebrados acuáticos que se alimentan de renacuajos de sapo se encuentran las larvas de libélula o los ditíscidos. Estos por lo general evitan la secreción nociva por punción de la piel del renacuajo y succión de los jugos.\r\n', '', '', '', ''),
(18, 'Carácterísticas', 'Las Anfiumas se conocen comúnmente como "anguilas del congo", un nombre completamente inapropiado si alguna vez hubo uno. En primer lugar, los anfiuros son anfibios, en lugar de peces (que son las anguilas). Además, el congo eel, que probablemente sea la base de este nombre común, es un pez marino. A pesar de esto, los amphiumas ciertamente se parecen a los peces alargados. Es fácil pasar por alto las diminutas piernas, y la falta de branquias externas (a diferencia de las sirenas) se suma a la similitud entre los amphiumas y las anguilas. Los amphiumas tienen dos pares de patas, y las tres especies, todas las cuales se encuentran en el sudeste de los Estados Unidos, difieren en cuanto a la cantidad de dedos en los extremos de estas extremidades. Hay tres especies: una especie tiene un dedo del pie, una tiene dos y la tercera tiene tres dedos por extremidad\r\n', 'Habitat', 'El amphiuma de un dedo tiene un rango restringido que se encuentra principalmente en Florida y apenas se extiende hacia el sur de Georgia. Es una especie protegida en Georgia', 'Comportamiento', 'Las amphiumas de un dedo se activan mayormente durante la noche, cuando buscan la presa de invertebrados. Sus hábitos son similares a los de los otros miembros de su género, prefiriendo el movimiento lento o el estancamiento en las aguas poco profundas con fondos fangosos o áreas con vegetación de malezas. Tienen una afinidad especial por los depósitos de lodo semifluido que se acumulan en las llanuras inundables pantanosas de los ríos y arroyos o en los bordes de los ríos costeros alimentados por manantiales. Como todas las anfias, las anfibias de un solo dedo comen pequeños invertebrados acuáticos como el cangrejo de río, los gusanos anélidos, las larvas de insectos y, ocasionalmente, las larvas de peces o anfibios. Sus hábitos de reproducción son en gran parte desconocidos, pero se han encontrado hembras meditando huevos debajo de troncos y esteras de musgo sphagnum en situaciones fangosas.', '', '', '', '');

